<template>
	<view>
		<view class="CommissionRank">
		    <view class="header">
		      <view class="rank" v-if="position">ÊÇ®ÁõÆÂâçÁöÑÊéíÂêç<text class="num">{{position}}</text>Âêç</view>
		      <view class="rank" v-else>ÊÇ®ÁõÆÂâçÊöÇÊó†ÊéíÂêç</view>
		    </view>
		    <view class="wrapper">
		      <view class="nav acea-row row-around">
		        <view class="item" :class="active == index ? 'font-color' : ''" v-for="(item,index) in navList" :key="index" @click="switchTap(index)">
		          {{ item }}
		        </view>
		      </view>
		      <view class="list">
		      <view class="item acea-row row-between-wrapper" v-for="(item,index) in rankList" :key="index">
		        <view class="num" v-if="index <= 2">
		          <image :src="'/static/images/medal0'+(index+1)+'.png'"></image>
		        </view>
		        <view class="num" v-else>
		        {{index+1}}
		        </view>
		        <view class="picTxt acea-row row-between-wrapper">
		          <view class="pictrue"><image :src="item.avatar"></image></view>
		          <view class="text line1">{{item.nickname}}</view>
		        </view>
		        <view class="people font-color">Ôø•{{item.brokerage_price}}</view>
		      </view>
		    </view>
		    </view>
		  </view>
		  <!-- #ifdef MP -->
		  <authorize @onLoadFun="onLoadFun" :isAuto="isAuto" :isShowAuth="isShowAuth" @authColse="authColse"></authorize>
		  <!-- #endif -->
	</view>
</template>

<script>
	import { getBrokerageRank } from '@/api/user.js';
	import {
		toLogin
	} from '@/libs/login.js';
	 import {
	 	mapGetters
	 } from "vuex";
	 // #ifdef MP
	 import authorize from '@/components/Authorize';
	 // #endif
	export default {
		components: {
			// #ifdef MP
			authorize
			// #endif
		},
		data() {
			return {
				navList: ["Âë®ÊéíË°å", "ÊúàÊéíË°å"],
				    active: 0,
				    rankList:[],
				    page:1,
				    limit:10,
				    loadend:false,
				    loading:false,
				    loadTitle:'Âä†ËΩΩÊõ¥Â§ö',
				    type:'week',
				    position:0,
				isAuto: false, //Ê≤°ÊúâÊéàÊùÉÁöÑ‰∏ç‰ºöËá™Âä®ÊéàÊùÉ
				isShowAuth: false //ÊòØÂê¶ÈöêËóèÊéàÊùÉ
			};
		},
		computed: mapGetters(['isLogin']),
		onLoad(){
			if(this.isLogin){
				 this.getBrokerageRankList();
			}else{
				// #ifdef H5 || APP-PLUS
				toLogin();
				// #endif 
				// #ifdef MP
				this.isAuto = true;
				this.$set(this,'isShowAuth',true)
				// #endif
			}
		},
		methods: {
			 onLoadFun:function(){
			    this.getBrokerageRankList();
			  },
			// ÊéàÊùÉÂÖ≥Èó≠
			authColse:function(e){
				this.isShowAuth = e
			},
			switchTap:function(index){
				this.active = index;
				this.type = index ? 'month': 'week';
				this.page = 1;
				this.loadend = false;
				this.$set(this,'rankList',[]);
			    this.getBrokerageRankList();
			  },
			  getBrokerageRankList:function(){
			      if(this.loadend) return;
			      if(this.loading) return;
				  this.loading = true;
				  this.loadTitle = '';
			      getBrokerageRank({
			        page:this.page,
			        limit:this.limit,
			        type:this.type
			      }).then(res=>{
			        let list = res.data.rank;
			        let loadend = list.length < this.limit;
			        this.rankList.push.apply(this.rankList, list);
					this.loading = false;
					this.loadend = loadend;
					this.loadTitle = loadend ? 'üòïÊàë‰πüÊòØÊúâÂ∫ïÁ∫øÁöÑ':'Âä†ËΩΩÊõ¥Â§ö';
					this.$set(this,'rankList',this.rankList);
					this.position = res.data.position;
			      }).catch(err=>{
					  this.loading = false;
					  this.loadTitle = 'Âä†ËΩΩÊõ¥Â§ö';
			      })
			    }
		},
		 onReachBottom: function () {
		    this.getBrokerageRankList();
		  }
	}
</script>

